import React from 'react';

interface ScanResultsProps {
  scanResultsProps: number;
}

const ScanResults = ({ scanResultsProps }: ScanResultsProps) => {
  return (
    <div className="flex justify-center items-center h-screen bg-gradient-to-r from-indigo-500 to-sky-500">
      <h1>Scan Results</h1>
      <div></div>
      <p>Line count: {scanResultsProps}</p>
    </div>
  );
};

export default ScanResults;
